import React, { Component } from "react";



class MyFiles extends Component {
    onLogoutClick = e => {
      e.preventDefault();
      this.props.logoutUser();



    };

     routeChange=()=> {
      let path = `/upload`;
      //let history = useHistory();
     // history.push(path);
    }



    render() {
      const { user } = this.props.auth;

      return (
        <div style={{ height: "75vh" }} className="container valign-wrapper">
          <div className="row">
            <div className="landing-copy col s12 center-align">

              <h4>
                <b>Hey,</b> {user.name.split(" ")[0]} <b>!</b>
                <p className="flow-text grey-text text-darken-1">
                  You're logged in!
                </p>
              </h4>


              <LinkButton
              style={{
                  width: "150px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px",
                  marginTop: "1rem"
                }}
              to='/squid'
              onClick={(event) => {
                  console.log(event)
                }}
                className="btn btn-large waves-effect waves-light hoverable blue accent-3"
            >SQUID</LinkButton>


              <LinkButton
              style={{
                  width: "150px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px",
                  marginTop: "1rem"
                }}
              to='/upload'
              onClick={(event) => {
                  console.log(event)
                }}
                className="btn btn-large waves-effect waves-light hoverable blue accent-3"
            >My files</LinkButton>

              <button
                style={{
                  width: "150px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px",
                  marginTop: "1rem"
                }}
                onClick={this.onLogoutClick}
                className="btn btn-large waves-effect waves-light hoverable blue accent-3"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      );
    }
  }

  Dashboard.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
  };

  const mapStateToProps = state => ({
    auth: state.auth
  });

  export default connect(
    mapStateToProps,
    { logoutUser }
  )(Dashboard);
